import java.nio.charset.StandardCharsets
def flowFile = session.get()
if(!flowFile) return
try {
	def now = new Date()
	def timestamp=now.format("yyyy-MM-dd'T'HH:mm:ss.SSS'Z'",TimeZone.getTimeZone('UTC'))
	flowFile=session.putAttribute(flowFile,'agent_timestamp',timestamp)
	processGroupName=context.getName()
	flowFile=session.putAttribute(flowFile,'metadata_resource_id',processGroupName)
	flowFile = session. putAttribute(flowFile, 'error _message', "Bad json format or mapping, rejected by elasticsearch.")
	if(flowFile.getAttribute("failure.count")==null && flowFile.getAttribute("mime.type")=="application/json")
		session.transfer(flowFile,REL_FAILURE)
	else
		session.transfer(flowFile,REL_SUCCESS)
}
catch(e){
log.error(e)
session.transfer(flowFile,REL_FAILURE)
}

